    setage(age)
   
}
   
    

const handleclick =(e)=>{                              
    e.preventDefault();
    setliste([...liste , name ])
    console.log(liste);
  
    }                                                                         

    return(
       <>
        <input type="text" name="name" id="name" onChange={handlename} />
        <input type="text" name="age" id="age"  onChange={handleage}/>
        <input type="submit" name="submit" id="submit" onClick={handleclick}/>

        <table border="1px">
            <tr>
                <td>name</td>
              
            </tr>
            <tr>
                <td>{<td>{liste.map}</td>}</td>
            </tr>
        </table>
       </>
    )
}
